            "Comprendre la zone de fréquence cardiaque"),
        "hrzone_intro_understandhr_des": MessageLookupByLibrary.simpleMessage(
            "Chaque zone de fréquence cardiaque influence votre corps pendant l\'entraînement. Se concentrer sur différentes zones vous aide à construire une routine équilibrée pour la force, l\'endurance et la puissance. Les zones inférieures sont idéales pour l\'échauffement et la récupération, tandis que les zones supérieures favorisent les progrès"),
        "hrzone_intro_zone1":
            MessageLookupByLibrary.simpleMessage("Zone 1 Échauffement"),
        "hrzone_intro_zone1_des": MessageLookupByLibrary.simpleMessage(
            "L\'entraînement dans cette zone améliore la capacité de votre cœur à pomper le sang et améliore la capacité des muscles à utiliser l\'oxygène. Le corps devient plus efficace pour nourrir les muscles en activité et apprend à métaboliser les graisses comme source d\'énergie."),
        "hrzone_intro_zone2":
            MessageLookupByLibrary.simpleMessage("Zone 2 Facile"),
        "hrzone_intro_zone2_des": MessageLookupByLibrary.simpleMessage(
            "Cette zone offre les mêmes avantages que la Zone 1, mais elle est plus intense et brûle plus de calories au total."),
        "hrzone_intro_zone3":
            MessageLookupByLibrary.simpleMessage("Zone 3 Aérobie"),
        "hrzone_intro_zone3_des": MessageLookupByLibrary.simpleMessage(
            "Le plus efficace pour la condition physique cardiovasculaire générale. Augmente votre capacité cardio-respiratoire : c\'est-à-dire votre capacité à transporter le sang oxygéné vers les cellules musculaires et le dioxyde de carbone loin des cellules. Efficace également pour augmenter la force musculaire générale."),
        "hrzone_intro_zone4":
            MessageLookupByLibrary.simpleMessage("Zone 4 Seuil"),
        "hrzone_intro_zone4_des": MessageLookupByLibrary.simpleMessage(
            "Le point où le corps ne peut pas éliminer l\'acide lactique aussi rapidement qu\'il est produit est appelé le seuil de lactate ou le seuil anaérobie. Il se produit généralement à environ 88 % de la zone de fréquence cardiaque. L\'entraînement dans cette zone aide à augmenter le seuil de lactate, ce qui améliore les performances. L\'entraînement dans cette zone est difficile : vos muscles sont fatigués, votre respiration est lourde."),
        "hrzone_intro_zone5":
            MessageLookupByLibrary.simpleMessage("Zone 5 Maximum"),
        "hrzone_intro_zone5_des": MessageLookupByLibrary.simpleMessage(
            "Vous ne devriez vous entraîner dans cette zone que si vous êtes en très bonne forme physique et uniquement pendant de très courtes périodes. L\'acide lactique se développe rapidement car vous fonctionnez en déficit d\'oxygène pour les muscles. L\'intérêt de l\'entraînement dans cette zone est que vous pouvez augmenter vos fibres musculaires à contraction rapide, ce qui augmente la vitesse."),
