        "workouts_detail_info_hrv_content1": MessageLookupByLibrary.simpleMessage(
            "La variabilité de la fréquence cardiaque, également connue sous le nom de VFC, représente la variance dans le temps entre chaque battement de cœur. Ainsi, alors que votre fréquence cardiaque mesure combien de fois votre cœur bat par minute, la VFC est la variance dans le temps entre ces battements."),
        "workouts_detail_info_hrv_content2": MessageLookupByLibrary.simpleMessage(
            "Votre variabilité de la fréquence cardiaque est une expression importante de votre capacité à faire face et à récupérer du stress, qu\'il s\'agisse d\'un facteur de stress physique (comme l\'exercice ou la maladie) ou d\'un facteur de stress émotionnel et mental (comme l\'anxiété). Augmenter votre variabilité de la fréquence cardiaque signifie mieux dormir, réduire la douleur et améliorer votre santé et votre condition physique générales."),
        "workouts_detail_info_hrv_content3_1": MessageLookupByLibrary.simpleMessage(
            "Votre variabilité individuelle de la fréquence cardiaque est représentée par votre score de VRC. La VRC est généralement mesurée en millisecondes, un score de VRC plus élevé indiquant une meilleure santé."),
        "workouts_detail_info_hrv_content3_2": MessageLookupByLibrary.simpleMessage(
            "Pour comprendre pourquoi un score de VRC élevé est un indicateur de bonne santé, vous devez savoir que la variabilité de la fréquence cardiaque est contrôlée par le système nerveux autonome (ou SNA). Le système nerveux autonome régule les fonctions corporelles involontaires (comme la digestion, la pression artérielle, la respiration et la fréquence cardiaque) et est composé de deux branches : le système nerveux sympathique (\"mode combat ou fuite\") et le système nerveux parasympathique (\"mode repos, digestion et récupération\")."),
        "workouts_detail_info_hrv_content3_3": MessageLookupByLibrary.simpleMessage(
            "Le système nerveux sympathique, communément appelé le mode \"combat ou fuite\", est activé involontairement lorsque votre corps perçoit une menace. Afin de se protéger, le corps utilise le système nerveux sympathique pour accélérer la respiration, augmenter la pression sanguine et élever les hormones du stress comme le cortisol, afin de s\'assurer que vous disposez de toute l\'énergie et des ressources nécessaires pour vous protéger dans une situation dangereuse."),
        "workouts_detail_info_hrv_content3_4": MessageLookupByLibrary.simpleMessage(
            "Le système nerveux parasympathique, le mode \"repos et digestion\", est un état de relaxation. Il diminue votre fréquence cardiaque, ralentit la respiration et permet à votre corps de revenir à l\'homéostasie (un équilibre naturel). Lorsque vous êtes dans un état parasympathique, votre corps se sent en sécurité en réallouant le flux sanguin et l\'énergie vers des fonctions de restauration telles que le sommeil, la digestion et la reproduction."),
        "workouts_detail_info_hrv_content3_5": MessageLookupByLibrary.simpleMessage(
            "Par conséquent, une grande variance dans le temps entre vos battements de cœur, également appelée score HRV élevé, signifie que votre système nerveux autonome est capable de réagir efficacement en activant le système nerveux sympathique pour faire face aux situations stressantes, puis en passant à l\'état parasympathique détendu lorsque la menace a disparu."),
        "workouts_detail_info_hrv_content4_1": MessageLookupByLibrary.simpleMessage(
            "Évaluation de l\'intensité et de la récupération : En surveillant la HRV, les individus peuvent mieux comprendre leur niveau de fatigue physique et leur état de récupération. Une HRV plus basse pourrait indiquer un surentraînement ou une récupération insuffisante, incitant à des ajustements du plan d\'entraînement, tels que l\'augmentation des périodes de repos ou le passage à des exercices de faible intensité pour éviter une tension excessive."),
        "workouts_detail_info_hrv_content4_2": MessageLookupByLibrary.simpleMessage(
            "Connexion entre le stress psychologique et la performance physique : Un stress psychologique prolongé peut entraîner une diminution de la HRV, affectant la performance sportive. Par conséquent, maintenir une bonne HRV contribue à des états psychologiques et physiologiques optimaux, améliorant ainsi la performance compétitive."),
        "workouts_detail_info_hrv_content5": MessageLookupByLibrary.simpleMessage(
            "En résumé, la variabilité de la fréquence cardiaque joue un rôle crucial dans la guidance des routines d\'exercices individuelles, la surveillance de l\'état de santé général et la prédiction des performances athlétiques. En suivant et en analysant les changements de la HRV, les individus peuvent prendre des décisions informées et scientifiques concernant leur programme de remise en forme."),
        "workouts_detail_info_hrv_content_title1":
            MessageLookupByLibrary.simpleMessage(
                "Qu\'est-ce que la variabilité de la fréquence cardiaque ?"),
